#include <string>
using namespace std;

int main() {
    string s;
    getline(cin, s);

    // Validate input and count vowels
    int vowelCount = 0;
    for (char c : s) {
        if (c < 'a' || c > 'z') {
            cout << "Invalid!" << endl;
            return 0;
        }
        if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
            vowelCount++;
        }
    }

    cout << vowelCount << endl;
    return 0;
}

